import React from 'react';

const RegistrationTable = ({ data }) => {
  return (
    <div>
      <h2>Registration Data</h2>
      <table style={{ width: '100%', borderCollapse: 'collapse' }}>
        <thead>
          <tr>
            <th style={{ border: '1px solid black', padding: '8px' }}>Name</th>
            <th style={{ border: '1px solid black', padding: '8px' }}>Email</th>
            <th style={{ border: '1px solid black', padding: '8px' }}>Phone</th>
            <th style={{ border: '1px solid black', padding: '8px' }}>Address</th>
          </tr>
        </thead>
        <tbody>
          {data && data.length > 0 ? (
            data.map((item, index) => (
              <tr key={index}>
                <td style={{ border: '1px solid black', padding: '8px' }}>{item.name}</td>
                <td style={{ border: '1px solid black', padding: '8px' }}>{item.email}</td>
                <td style={{ border: '1px solid black', padding: '8px' }}>{item.phone}</td>
                <td style={{ border: '1px solid black', padding: '8px' }}>{item.address}</td>
              </tr>
            ))
          ) : (
            <tr>
              <td colSpan="4" style={{ textAlign: 'center', padding: '8px' }}>
                No registration data available.
              </td>
            </tr>
          )}
        </tbody>
      </table>
    </div>
  );
};

export default RegistrationTable;
